import React from 'react';
import './styles/Page.css';
import ServicesPage from '../Assets/images/Главная.svg';

function Home() {
  return (
    <div className='abut-container'>
      <img src={ServicesPage} alt="Services Background" />
      <div className="buttons">
        <button className="login-btn">Войти</button>
        <button className="register-btn">Зарегистрироваться</button>
      </div>
    </div>
  );
}

export default Home;
